const initialState = [
    {id: 'react', imgURL: "https://cdn.iconscout.com/icon/free/png-256/react-1-282599.png", title: "React"},
    {id: 'angular', imgURL: "https://www.pngitem.com/pimgs/m/498-4986855_transparent-fashion-icon-png-angular-js-logo-png.png", title: "Angular"},
    {id: 'vue', imgURL: "https://w0.pngwave.com/png/21/719/vue-js-javascrip…-and-back-ends-typescript-github-png-clip-art.png", title: "vue"},
    {id: 'JS', imgURL: "https://upload.wikimedia.org/wikipedia/commons/thu…2.svg/1200px-Unofficial_JavaScript_logo_2.svg.png", title: "JavaScript"},
    {id: 'CSS', imgURL: "https://www.kindpng.com/picc/m/464-4640184_css3-png-download-css-icon-transparent-png.png", title: "CSS"},
    {id: 'HTML', imgURL: "https://icons.iconarchive.com/icons/cornmanthe3rd/plex/512/Other-html-5-icon.png", title: "HTML"}
]

export const setCatalog = (catalogData) => ({type: 'SET_CATALOG', data: catalogData})

export const catalogReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_CATALOG':
            return state = action.data
        default:
            return state
    }
}
